import gev from '../images/GEV.png';
import nselogo from '../images/NSE-logo.png'
import iitk_logo from '../images/iitk_logo.png';
import igbc from '../images/IGBC.jpg'

import goi from '../images/Government_of_India_logo.png'
import cii from "../images/cii-logo.png"
import crdc from "../images/creduce-logo.png"
import ficci from"../images/FICCI_logo.png"
import ssa from "../images/ssa-logo.jpeg"
import terviva from "../images/terviva-logo.png"
import gom from "../images/Seal_of_Maharashtra.svg.webp"
import nitw from"../images/NITW-logo.png"
import moefcc from "../images/moefcc-logo.jpg"
import iitb from "../images/IITB_Logo.svg"
import iiti from "../images/IIT_Indore_Logo.png"
import assocham from "../images/assocham-logo.jpg"

const SupportersLogo = { 
  Organiser:[
    {title:'GEV', img : gev, webpage :'https://ecovillage.org.in/'}
  ],
  Venue :[
    {title:'NSE', img : nselogo, webpage :'https://www.nseindia.com'}
  ],
  Associate :[
    {title:'IIT Kanpur', img : iitk, webpage :''},
    {title:'', img : '', webpage :''}
  ],

    Supporters_1: [        
        
        {title:'IIT Bombay', img : iitb, webpage :'https://www.iitb.ac.in/'},
        {title:'IIT Indore', img : iiti, webpage :'https://www.iiti.ac.in/'},
        {title:'NIT Warangal', img : nitw, webpage :'https://www.nitw.ac.in/'},
        {title:'CII', img : cii, webpage :'https://www.cii.in/'},
        {title:'FICCI', img : ficci, webpage :'https://www.ficci.in/'},
        {title:'ASSOCHAM', img : assocham, webpage :'https://www.assocham.org/'},
  
      ],
    Supporters_2:[
      {title:'Terviva', img : terviva, webpage :'https://terviva.com/'},
      {title:'Creduce', img : crdc, webpage :'https://creduce.tech/'},
      {title:'SSA', img : ssa, webpage :'https://ssaarchitects.com/'}
    ]

    };


export default SupportersLogo;
